import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { useDispatch } from 'react-redux';
import { Channel, User, RootState } from '../../../types';
import { getChannelUsers, removeChannelMember } from '../../../services/api/chat';
import { setError } from '../../../store/chat/chatSlice';
import Modal from '../../common/Modal';
import Button from '../../common/Button';

const SettingsContainer = styled.div`
  padding: 20px;
`;

const Section = styled.div`
  margin-bottom: 24px;
`;

const SectionTitle = styled.h3`
  margin: 0 0 16px 0;
  font-size: 1rem;
  text-transform: uppercase;
  color: ${props => props.theme.colors.primary};
`;

const MemberList = styled.div`
  display: flex;
  flex-direction: column;
  gap: 8px;
`;

const MemberItem = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 8px;
  border: 1px solid ${props => props.theme.colors.border};
`;

const MemberInfo = styled.div`
  display: flex;
  align-items: center;
  gap: 8px;
`;

const Username = styled.span`
  font-weight: bold;
`;

const Status = styled.span`
  font-size: 0.875rem;
  color: ${props => props.theme.colors.textLight};
`;

const OwnerBadge = styled.span`
  font-size: 0.75rem;
  padding: 2px 6px;
  background-color: ${props => props.theme.colors.primary};
  color: ${props => props.theme.colors.background};
  border-radius: 4px;
  text-transform: uppercase;
`;

const RemoveButton = styled(Button)`
  padding: 4px 8px;
  font-size: 0.875rem;
`;

const LoadingSpinner = styled.div`
  color: ${props => props.theme.colors.textLight};
  font-size: 0.875rem;
`;

interface ChannelSettingsProps {
  isOpen: boolean;
  channel: Channel;
  onClose: () => void;
}

interface ChannelMember extends User {
  isOwner: boolean;
}

const ChannelSettings: React.FC<ChannelSettingsProps> = ({ isOpen, channel, onClose }) => {
  const dispatch = useDispatch();
  const [members, setMembers] = useState<ChannelMember[]>([]);
  const [isLoading, setIsLoading] = useState(false);
  const [loadingMemberId, setLoadingMemberId] = useState<string | null>(null);

  useEffect(() => {
    const fetchMembers = async () => {
      try {
        setIsLoading(true);
        const users = await getChannelUsers(channel.id);
        const channelMembers = users.map(user => ({
          ...user,
          isOwner: user.id === channel.created_by_id
        }));
        setMembers(channelMembers);
      } catch (error) {
        console.error('Failed to fetch channel members:', error);
        dispatch(setError('Failed to fetch channel members'));
      } finally {
        setIsLoading(false);
      }
    };

    if (isOpen) {
      fetchMembers();
    }
  }, [isOpen, channel.id, channel.created_by_id, dispatch]);

  const handleRemoveMember = async (userId: string) => {
    try {
      setLoadingMemberId(userId);
      await removeChannelMember(channel.id, userId);
      setMembers(prevMembers => prevMembers.filter(member => member.id !== userId));
    } catch (error) {
      console.error('Failed to remove member:', error);
      dispatch(setError('Failed to remove member'));
    } finally {
      setLoadingMemberId(null);
    }
  };

  return (
    <Modal isOpen={isOpen} onClose={onClose} title="Channel Settings">
      <SettingsContainer>
        <Section>
          <SectionTitle>Channel Members</SectionTitle>
          <MemberList>
            {members.map((member: ChannelMember) => (
              <MemberItem key={member.id}>
                <MemberInfo>
                  <Username>{member.username}</Username>
                  <Status>{member.status}</Status>
                  {member.isOwner && <OwnerBadge>Owner</OwnerBadge>}
                </MemberInfo>
                {!member.isOwner && (
                  <RemoveButton
                    onClick={() => handleRemoveMember(member.id)}
                    disabled={isLoading || loadingMemberId === member.id}
                  >
                    {loadingMemberId === member.id ? '...' : 'Remove'}
                  </RemoveButton>
                )}
                {loadingMemberId === member.id && (
                  <LoadingSpinner>Loading...</LoadingSpinner>
                )}
              </MemberItem>
            ))}
          </MemberList>
        </Section>
      </SettingsContainer>
    </Modal>
  );
};

export default ChannelSettings;
